import React from "react";
import { Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

const MainPage = () => {
  return (
    <div class="container">
      <div class="row justify-content-start align-self-center">
        <div id="title" class="col-8">
          <h1>
            WSN-Based Water Quality
            <br /> Monitoring Application
          </h1>
          <br />
        </div>
      </div>
      <div class="row justify-content-start align-self-center">
        <div id="subtitle" class="col-8">
          <h5>by Frederick - 2016730040</h5>
        </div>
      </div>
      <div>
        <button class="btn-round" href="signIn">
          Login
        </button>
      </div>
    </div>
  );
};

export default MainPage;
